import React from 'react';

  

function About(){
    return(
        <div>
            <Switch>
            <Link to="./About.js">About</Link>
        </Switch>
        <Switch>
            <Link to="./Feedback.js">Feedback</Link>
        </Switch>
        <Switch>
            <Link to="/">Home</Link>
        </Switch>

        </div>
    )
}
export default About;
